import React from 'react';
import { DraggableItem } from '../components/Generals/DraggableItem';
import { ShapeType } from '../contexts/DraggableContext';

const shapes: { id: number; type: ShapeType }[] = [
  { id: 1, type: 'circle' },
  { id: 2, type: 'rectangle' },
  { id: 3, type: 'vector' },
];

export const ShapeLibrary: React.FC = () => {
  return (
    <div>
      {shapes.map((shape) => (
        <DraggableItem key={shape.id} id={shape.id} type={shape.type} />
      ))}
    </div>
  );
};
